window.onload=()=>{new Swiper(".mySwiper",{spaceBetween:10,width:156,direction:"horizontal",loop:!1,breakpoints:{768:{slidesPerView:5,spaceBetween:40},1024:{slidesPerView:5,spaceBetween:40}}});fecthDataSeguros(),fecthDataBancos()};const fecthDataSeguros=async()=>{await fetch("http://127.0.0.1:8000/seguros").then(e=>e.json()).then(e=>{setSliderOne(e)}).catch(e=>{console.log("Error: ",e)})},fecthDataBancos=async()=>{await fetch("http://127.0.0.1:8000/bancos").then(e=>e.json()).then(e=>{setSliderTwo(e)}).catch(e=>{console.log("Error: ",e)})},setSliderOne=e=>{const d=document.querySelector(".l-service__slide1 .swiper .swiper-wrapper");e.forEach(e=>{const t=document.createElement("div");t.classList.add("swiper-slide"),d.appendChild(t);const s=document.createElement("p");s.classList.add("slider-title"),s.textContent=e.title,t.appendChild(s);const n=document.createElement("p");n.classList.add("slider-from"),n.textContent="Desde",t.appendChild(n);const c=document.createElement("p");c.classList.add("slider-price"),c.textContent=e.price_from+" €/mes",t.appendChild(c)})},setSliderTwo=e=>{console.log(e);const d=document.querySelector(".l-service__slide2 .swiper .swiper-wrapper");e.forEach(e=>{const t=document.createElement("div");t.classList.add("swiper-slide"),d.appendChild(t);const s=document.createElement("p");s.classList.add("slider-title"),s.textContent="Hasta "+e.max+" €",t.appendChild(s);const n=document.createElement("p");n.classList.add("slider-from"),n.textContent="Cuota desde",t.appendChild(n);const c=document.createElement("p");c.classList.add("slider-price"),c.textContent=e.fee+" €/mes",t.appendChild(c)})};